import React from 'react';

const Post = ({ postData }) => {
  return (
    <div className="container m-2 webdv-playlist-style">
      <div className="row">
        <div className="col">
          <span>This is a test post written by someone.</span>
        </div>
      </div>
    </div>
  );
};

export default Post;
